import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import 'bootstrap/dist/css/bootstrap.min.css'

export const API_URL_RECIPES = "http://127.0.0.1:8000/api/recipes"
export const API_URL_CATEGORIES = "http://127.0.0.1:8000/api/category"

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
